import React from 'react'
import './About.css'
import bg from '../image/me3.png';

const About = () => {
    return (
        <div style={{ alignItems: 'center', justifyContent: 'center', width: '100%' }}>
            <text style={{ color: 'black',alignSelf: 'center' }}>Shashwat</text>

            <img src={bg} style={{ width: '100%', height: '100%' }} />
        </div>


    )
}
export default About;
